import React from 'react';
import { Navbar} from '../components';

const PastPapers = () => {
  return (
    <div className="w-full min-h-screen">
      <Navbar />

      <div className="flex w-full ml-[5%] mt-[10%] grid grid-cols-4 text-white">

          <div className="bg-black w-[100%] h-[100%] rounded-md px-4 ">
            <div className="text-center py-5">
              <p>Biology</p>
            </div>
            <hr></hr>
          </div>

          <div className="ml-[10%] bg-black w-[100%] h-[100%] rounded-md px-4 py-5">
            <div className="text-center">
              <p>Biology</p>
              <hr></hr>
            </div> 
          </div>

      </div>
</div>
  );
};

export default PastPapers;
